  const [input, setInput] = useState('');
  console.log(input);
  return (
    <div className="App">
      <h1>Facebook messenger clone</h1>


      <input value={input} onChange={event => setInput(event.target.value)}/>
      <button>Send message </button>


    </div>
  );
}

export default App;
